const Footer = () => (
 
    <footer 
    id="sticky-footer" 
    className="py-4 bg-dark text-white-50">
    <div className="container text-center">
      <small>Copyright &copy; Your Website</small>
    </div>
    <style>{`
   
        #sticky-footer {
            margin-top: 20%;
        }
    
  
  
`}</style>
  </footer>



)


export default Footer
